import React from "react";
//import TaskCard from "../components/Card/TaskCard";
//import TaskCard from "../components/TaskCard";
import TaskCard from "../../components/Card/TaskCard";
import { useNavigate } from "react-router";

const Home = () => {
  //!!variable provisional(isLogged), de escuchar al Store
  const isLogged = true;
  const navigate = useNavigate();
  return (
    <div>
      Home, Aqui se renderiza TaskCard(TaskComponent(Task), Taskformik), --Aqui
      NAVEGA hacia el perfil donde esta el editor de tareas--
      <h1>Este es el homePage</h1>
      <button
        onClick={() =>
          isLogged
            ? navigate("/Profile")
            : navigate("/Login&Register") + alert("log first")
        }
      >
        Go to Profile!
      </button>
    </div>
  );
};

export default Home;
